import React from 'react'
import './cptStyle.css'

const CPT0Industry = (props) => {
  return (
    <div className='m-4 d-flex justify-content-center align-items-center border border-dark'>
      <div className='border border-primary text-align-center'>หากคุณยังไม่เคยใช้ระบบนี้มาก่อนเราแนะนำให้คุณสร้างโปรเจกธุรกิจจากเทมเพลตของเรา</div>
    </div>
  )
}

export default CPT0Industry
